import "./EmployeeCard.css";

const EmployeeCard = (props) => {
  const imgPath = props.employee.picture.large;
  return (
    <div className="employee-card">
      <img src={imgPath} />
      {props.employee.title}
    </div>
  );
};

export default EmployeeCard;
